import s from './Kurmaev.module.css'

const Kurmaev = (props) => {

	
	return (
		<div className={s.main}>
			<main class="col-md-9 ms-sm-auto col-lg-10 px-md-4">

				<div className={s.main}>
                  
					купи колбасы заебал

				</div>
			</main>

		</div>
	);
}

export default Kurmaev;
